function [T, Cal] = Fenwal192(R)%FENWAL192 -- converts thermistor resistance to temperature%  [T, Cal] = Fenwal192(R)%=====================================================================% input R in ohms, (OMIT R for T = T(25C) and the cal table.)%%output%  T = temperature in degC%  Cal is the calibration table nx2%% rmr 000310%===================================================================% YSY THERMISTOR MODEL 44006 CALIBRATION CURVE % CALIBRATION VALUESCal = [...	-40 336500	-30 177000	-20 97070	-10 55330	0 32650	5 25390	10 19900	11 18970	12 18090	13 17250	14 16460	15 15710	16 15000	17 14320	18 13680	19 13070	20 12490	21 11940	22 11420	23 10920	24 10450	25 10000	26 9572	27 9165	28 8778	29 8409	30 8057	31 7722	32 7403	33 7099	34 6809	35 6532	36 6288	37 6016	38 5776	39 5546	40 5327	45 4369	50 3606	55 2986	60 2468	65 2083	70 1752];if nargin ==  0	fprintf('Fenwal192 returns Cal table only, compute T(10000 ohms)\n');	R = 10000;end	Tcal = Cal(:,1);Rt = Cal(:,2);T = interp1(Rt,Tcal,R);return;